import './App.css';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import ButtonGroup from '@mui/material/ButtonGroup';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>THINGS TO DO</h1>
        <TextField id="outlined-basic" label="Add New" variant="outlined" style={{display:'inline-block',marginLeft:'20%', marginRight:'20%'}}/>
        <ButtonGroup variant="contained" aria-label="Basic button group" style={{display:'inline-block'}}>
          <Button>One</Button>
          <Button>Two</Button>
        </ButtonGroup>
      </header>
    </div>
  );
}

export default App;
